import Container from "../pages/home/projects";
import {LiWrapper} from "./webcomps";
import PropTypes from "prop-types";
import SectionTitle from "./sectionTitle";

const TaskList = ({ listHeader }) => (
    <Container>
        <SectionTitle title={listHeader}/>
        <ul>
            {taskList.map(item => (
                <LiWrapper>
                    <span>{item}</span>
                </LiWrapper>
            ))}
        </ul>
    </Container>
);

TaskList.propTypes = {
    listHeader: PropTypes.string.isRequired,
    taskList: PropTypes.arrayOf(PropTypes.string).isRequired,
};

export default TaskList;
